# Parse the HTML with BeautifulSoup
soup = BeautifulSoup(html, "html.parser")
records = []

# Locate the container that holds the records
container = soup.find(id="ctl00_tdCompanyList")
if container:
    # Find all tables that represent a record.
    # We use the class "groupbox_large" and require an onclick attribute.
    record_tables = container.find_all("table", class_="groupbox_large", onclick=True)
    
    for table in record_tables:
        record = {}

        # Extract the company URL from the onclick attribute:
        onclick_attr = table.get("onclick", "")
        m = re.search(r"document\.location\.href\s*=\s*'([^']+)'", onclick_attr)
        record["company_url"] = m.group(1) if m else None

        # Find the nested details table which holds the text
        details_table = table.find("table", class_="groupbox_large_break_text")
        if not details_table:
            continue  # skip if no details table is found

        # --- Extract Person Name & Job Title ---
        first_row = details_table.find("tr")
        if first_row:
            a_tag = first_row.find("a", class_="groupbox_large_title_link")
            if a_tag:
                record["person_name"] = a_tag.get_text(strip=True)
            else:
                record["person_name"] = None

            job_span = first_row.find("span", itemprop="jobtitle")
            record["job_title"] = job_span.get_text(strip=True) if job_span else None

        # --- Extract Company Name ---
        # Assuming the company name is in the third row (skip spacer rows)
        company_row = details_table.find_all("tr")[2] if len(details_table.find_all("tr")) > 2 else None
        if company_row:
            comp_a = company_row.find("a", class_="groupbox_large_title_link")
            record["company_name"] = comp_a.get_text(strip=True) if comp_a else company_row.get_text(strip=True)
        else:
            record["company_name"] = None

        # --- Extract Company Type ---
        # Look for a row with a single cell containing the company type.
        comp_type_row = None
        for row in details_table.find_all("tr"):
            if row.find("td", colspan="2") and "FOR-PROFIT" in row.get_text():
                comp_type_row = row
                break
        record["company_type"] = comp_type_row.get_text(strip=True) if comp_type_row else None

        # --- Extract Address ---
        addr_td = details_table.find("td", string=lambda text: text and "Address:" in text)
        if addr_td:
            addr_value_td = addr_td.find_next_sibling("td")
            if addr_value_td:
                # Join text parts with a space (this will include street, locality, region, etc.)
                record["address"] = addr_value_td.get_text(separator=" ", strip=True)
            else:
                record["address"] = None
        else:
            record["address"] = None

        # --- Extract Registered Agent ---
        agent_td = details_table.find("td", string=lambda text: text and "Registered" in text and "Agent:" in text)
        if agent_td:
            agent_value_td = agent_td.find_next_sibling("td")
            record["registered_agent"] = agent_value_td.get_text(strip=True) if agent_value_td else None
        else:
            record["registered_agent"] = None

        # --- Extract Filing Date ---
        filed_td = details_table.find("td", string=lambda text: text and "Filed:" in text)
        if filed_td:
            filed_value_td = filed_td.find_next_sibling("td")
            record["filed_date"] = filed_value_td.get_text(strip=True) if filed_value_td else None
        else:
            record["filed_date"] = None

        # --- Extract File Number ---
        file_num_td = details_table.find("td", string=lambda text: text and "File" in text and "Number:" in text)
        if file_num_td:
            file_num_value_td = file_num_td.find_next_sibling("td")
            record["file_number"] = file_num_value_td.get_text(strip=True) if file_num_value_td else None
        else:
            record["file_number"] = None

        records.append(record)

# Create a DataFrame from the list of record dictionaries
df = pd.DataFrame(records)

# Export the DataFrame to an Excel file
df.to_excel("output.xlsx", index=False)
print("Data exported to output.xlsx")
